INSERT INTO `tb_news` (`id`, `title`, `summary`, `body`, `images`, `view`, `hot`, `brand_id`, `created_at`, `updated_at`) VALUES
(1, 'Có nên mua Galaxy A01: Chiếc smartphone chính hãng giá rẻ nhất của Samsung có ưu điểm gì đáng để chọn ngoài thương hiệu?', 'Có nên mua Galaxy A01: Chiếc smartphone chính hãng giá rẻ nhất của Samsung có ưu điểm gì đáng để chọn ngoài thương hiệu?', 'Hiện tại Galaxy A01 đang là mẫu smartphone chính hãng của Samsung có giá bán rẻ nhất và đây là một sự lựa chọn cho học sinh, sinh viên, để tặng cho người thân hoặc làm máy phụ cũng được. Ngoài thương hiệu ra thì Galaxy A01 còn có những ưu điểm gì để khiến người dùng phải bỏ tiền ra hốt, vì mất tiền cả nên cái gì cũng theo lí trí chứ đừng nghe con tim.\r\nThấp bé nhẹ cân, bù lại sử dụng bằng một tay dễ dàng\r\nGalaxy A01 sở hữu ngoại hình nguyên khối, kích thước tổng thể là 146.3 x 70.9 x 8.3 mm so với các mẫu smartphone của hiện tại thì đây thuộc dạng kích thước thấp bé, nhẹ cân.\r\n\r\nKích thước màn hình đạt 5.7 inch cũng đủ lớn để xem nội dung rồi, sử dụng bằng một tay thuận tiện, không bị cấn. Khi lướt qua các diễn đàn hay gặp một số bạn trẻ thì mình biết được vẫn còn một lượng người dùng thích sử dụng smartphone gọn gàng, bỏ vào túi cũng dễ chịu.\r\nMáy cũng chỉ hoàn thiện bằng nhựa thôi nhưng không bị ọp ẹp, chất liệu nhựa nhám tuy rẻ tiền nhưng cũng hạn chế được việc bám mồ hôi, dấu vân tay. Mình cũng là một người hay ra mồ hôi và thấu hiểu được vấn đề này, sử dụng những smartphone bằng kính lung linh phải lau mặt lưng thường xuyên.\r\n\r\nVới 3 phiên bản màu sắc Đỏ, Xanh Dương, Đen tuy không đa dạng lắm, mình thấy đây đều là những màu sắc cơ bản và không bao giờ lỗi thời, hợp cho những người yêu thích vẻ đẹp bình dị, đơn giản.Máy cũng chỉ hoàn thiện bằng nhựa thôi nhưng không bị ọp ẹp, chất liệu nhựa nhám tuy rẻ tiền nhưng cũng hạn chế được việc bám mồ hôi, dấu vân tay. Mình cũng là một người hay ra mồ hôi và thấu hiểu được vấn đề này, sử dụng những smartphone bằng kính lung linh phải lau mặt lưng thường xuyên.\r\n\r\nVới 3 phiên bản màu sắc Đỏ, Xanh Dương, Đen tuy không đa dạng lắm, mình thấy đây đều là những màu sắc cơ bản và không bao giờ lỗi thời, hợp cho những người yêu thích vẻ đẹp bình dị, đơn giản.\r\nKhông phải là màn hình AMOLED nhưng chất lượng hình ảnh vẫn ổn\r\nNhững Samfan đang cảm thấy hụt hẫng vì Galaxy A01 không tích hợp màn hình AMOLED. Bởi công nghệ màn hình này cho màu sắc hiển thị rực rỡ, tái tạo màu sắc tốt và độ sáng cao. \r\nVì nằm ở phân khúc giá rẻ, cho nên Galaxy A01 chỉ sử dụng tấm nền IPS LCD độ phân giải HD +. Màn hình này vẫn cho chất lượng không hề tệ, mật độ điểm ảnh 301 ppi tương đối sắc nét, sử dụng trong nhà hay các điều kiện khác vẫn ổn chỉ gặp khó một chút khi sử dụng dưới ánh sáng mặt trời do độ sáng màn hình không cao mà thôi.\r\n\r\nCài sẵn hệ điều hành Android 10 hoàn toàn mới\r\nGalaxy A01 trang bị một chip \"rồng\" không mấy nổi bật, chúng ta không thể chiến những tựa game 3D mượt mà được, hay trải nghiệm những tác vụ nặng hay load ứng dụng nhanh được, khi sử dụng hàng ngày nhiệt độ của máy tỏa ra không nóng.\r\nRất may nhiều smartphone giá rẻ vẫn chưa được chào đón hệ điều hành Android 10 thì Galaxy A01 đã có. Giao diện thiết kế thú vị, tối giản, có chủ đề nền tối mà nhiều người yêu thích và các biểu tượng thông báo cũng được thiết kế lại đẹp mắt, bổ sung tính năng thao tác toàn màn hình cho nên các phím điều hướng truyền thống đã được ẩn khiến màn hình gọn hơn.\r\n\r\nViên pin 3K thôi, đừng chê vẫn đủ xài\r\nNgười ngoài nhìn vào thì nghĩ viên pin 3.000 mAh hẻo quá làm sao dùng đây? Không phải như thế đâu, ở chế độ chờ Galaxy A01 cho thời gian chờ đến 72 giờ, có thể sử dụng 1 ngày ở nhu cầu cơ bản như kiểu chụp ảnh, duyệt web, xem video hay chơi game nhẹ.\r\n\r\nĐối với những người chuyên gọi điện để liên lạc thì bạn sẽ có khoảng 30 tiếng đồng hồ. Do sản phẩm này không hỗ trợ sạc nhanh, có thể sạc đầy 100% pin trong khoảng 2-2.5 giờ, một khoảng thời gian tạm chấp nhận được.\r\n\r\nKết luận chung\r\nKhông biết bạn có ý kiến gì về Galaxy A01, liệu \"em nó\" có sức cạnh tranh hay không?', 'samsung_24_02_2020_lMUpMuKN_galayxa01_800x450.jpg', 14, 0, 2, '2020-02-24 09:14:39', '2020-05-26 02:49:13'),
(2, 'Không chỉ tại Mỹ và Trung Quốc, Samsung Galaxy A71 5G bắt đầu tiến tới nhiều quốc gia khác', 'Không chỉ tại Mỹ và Trung Quốc, Samsung Galaxy A71 5G bắt đầu tiến tới nhiều quốc gia khác', 'Biến thể 5G của Galaxy A71 dường như sẽ bán ra tại nhiều quốc gia hơn. Trước khi Galaxy A71 được công bố chính thức, phiên bản 5G cũng bị phát hiện nhưng model này chỉ dành cho thị trường Trung Quốc (SM-A7160) và Mỹ.\r\nMới đây, một nguồn thân cận với Sammobile đã xác nhận rằng, Galaxy A71 5G sẽ tới với các thị trường khác. Cụ thể hơn, một biến thể Galaxy A71 với số model SM-A716B đang được phát triển.\r\n\r\nSamsung sử dụng chữ “B” ở cuối tên model cho những smartphone 5G được bán bên ngoài thị trường Mỹ và Hàn Quốc. Tại 2 thị trường này, chữ cuối cùng trong tên model lần lượt là chữ “U” và chữ “N”.\r\n\r\nTuy nhiên, chưa rõ SM-A716B sẽ hướng tới thị trường nước nào, nhiều khả năng sẽ là thị trường châu Âu và các quốc gia như Úc, New Zealand. Bởi trước đó, Galaxy A90 5G đã làm tương tự.\r\n\r\nBạn có mong đợi Galaxy A71 5G sẽ về Việt Nam không?', 'samsung_24_02_2020_jP22mLwb_1_1280x720-800-resize.jpg', 24, 0, 2, '2020-02-24 09:14:39', '2020-03-27 09:12:52'),
(3, 'Mong chờ để rồi hụt hẫng, Apple có thể trì hoãn sự kiện ra mắt iPhone 9 do các nhà máy sản xuất không thể đáp ứng đủ 50 % số hàng cung', 'Mong chờ để rồi hụt hẫng, Apple có thể trì hoãn sự kiện ra mắt iPhone 9 do các nhà máy sản xuất không thể đáp ứng đủ 50 % số hàng cung', 'Dịch Covid-19 bùng phát mạnh, Apple sẽ phải trì hoãn sự kiện giới thiệu iPhone 9 (hay iPhone SE 2) do năng lực sản xuất của Foxconn và các nhà máy khác không đủ tạo ra một nửa số lượng sản phẩm. Con số này rõ ràng không thể đáp ứng nhu cầu của thị trường sau khi niêm yết.\r\n\r\nMột số nguồn tin cho biết, Apple ban đầu dự định sẽ tổ chức một sự kiện để giới thiệu iPhone 9 giá rẻ vào cuối tháng 3. Sau đó sản phẩm sẽ được bán ra vào 03/04, nhưng do số lượng không đủ cung nên thời gian phát hành buộc phải trì hoãn và mốc thời gian mới vẫn chưa được xác định.\r\n\r\nTheo kế hoạch đề ra của Foxconn, họ kỳ vọng đáp ứng được 50% sản lượng vào cuối tháng 2 và lên kế hoạch khôi phục 80% sản lượng vào cuối tháng 3.\r\n\r\nDự kiến, iPhone 9 sẽ có trang bị màn hình LCD 4.7 inch với phần lưng được ốp kính. Máy sử dụng chip Apple A13 Bionic giống như dòng iPhone 11. Đồng thời, iPhone 9 sẽ tích hợp 3 GB RAM LPDDR4X và kết hợp cùng bộ nhớ lưu trữ 64 / 128 GB. Thiết bị sẽ có ba tùy chọn màu, gồm xám, bạc và đỏ.\r\n\r\nBạn nghĩ sao về vấn đề này?', 'iphone_24_02_2020_m6IXQHmI_ip92_800x449.jpg', 41, 0, 1, '2020-02-24 03:39:46', '2020-07-10 09:36:32'),
(6, 'OPPO A91 hot đến cỡ này, chỉ mới 1 ngày công bố thông tin mà hơn 1200 người đã đăng ký đợi hàng về, bạn có đang hóng không?', 'OPPO A91 hot đến cỡ này, chỉ mới 1 ngày công bố thông tin mà hơn 1200 người đã đăng ký đợi hàng về, bạn có đang hóng không?', 'Chỉ sau một ngày khởi động cho khách hàng đăng ký nhận thông tin, đã có hơn 1200 người mong muốn tìm hiểu thêm về sản phẩm và gần 10.000 người tìm kiếm may mắn trúng được OPPO A91. Bạn đã biết hết thông tin về sản phẩm này chưa?\r\n\r\nOPPO A91 chính là phiên bản mới nhất và tốt nhất của OPPO A Series tính đến thời điểm hiện tại khi hội tụ vẻ đẹp ngoại hình và cả sự mạnh mẽ ở hiệu năng. Chiếc smartphone có thiết kế cực kỳ \"sexy\" với độ mỏng nhẹ ấn tượng chỉ 7.9 mm và 172g.\r\n\r\nMàn hình cũng là điểm cộng lớn với tỷ lệ hiển thị lên đến 90.7%, độ phân giải Full HD+ sắc nét tha hồ trải nghiệm xem phim hay chơi game. \r\n\r\nĐây cũng là lần đầu tiên OPPO ưu ái trang bị sạc nhanh VOOC cho dòng A Series. Pin 4025 mAh mà còn tích hợp sạc nhanh là dư xài rồi nhé. Bên cạnh đó, máy có tích hợp mở khóa vân tay dưới màn hình tốc độ nhanh nhất trong phân khúc giá.\r\n\r\nOPPO A91 cũng có 4 camera với các ống kính chính 48 MP và phụ 8 MP, 2 MP, 2 MP. Máy trang bị chip MediaTek Helio P70 8 nhân, RAM 8 GB và bộ nhớ trong 128 GB quá bá đạo, thêm Game Boost 2.0 được thiết kế dành riêng cho các game thủ.\r\n\r\nSở hữu OPPO A91 từ ngày 03/03/2020 với 5000 suất hotsale giảm 500.000 đồng kèm trả góp 0%. Đăng ký nhận thông tin ngay hôm nay và tham gia game thử vận may, biết đâu trúng được điện thoại mới là quá đã luôn. \r\n\r\nBạn sẽ mua OPPO A91 chứ?', 'oppo_26_02_2020_GsGCj3ro_oppoa91-26_800x450.jpg', 8, 0, 3, '2020-02-26 15:11:27', '2020-03-27 09:13:05'),
(8, 'Huawei Nova 7 không chỉ hỗ trợ 5G, có cảm biến vân tay dưới màn hình mà còn đi kèm sạc nhanh 40W', 'Huawei Nova 7 không chỉ hỗ trợ 5G, có cảm biến vân tay dưới màn hình mà còn đi kèm sạc nhanh 40W', 'Vài ngày trước đây, có các nguồn tin xác nhận rằng Huawei sẽ ra mắt dòng smartphone Huawei Nova 7 vào tháng 4 tới, ngay sau khi trình làng dòng flagship Huawei P40 vào cuối tháng này.\r\nNguồn tin cũng tiết lộ sẽ có 3 model thuộc dòng Nova 7, bao gồm: Huawei Nova 7 5G, Nova 7 SE 5G và Nova 7 Pro 5G. Bây giờ là 1 chi tiết thú vị khác, đó là về khả năng sạc nhanh của Huawei Nova 7.\r\n\r\nMột smartphone mới của Huwei với số model CDY-AN00 vừa thông qua chứng nhận 3C tại Trung Quốc, chứng nhận này cho thấy máy sẽ hỗ trợ sạc nhanh 40W giống như Huawei P40 Pro.\r\n\r\nModel của bộ sạc được ghi là HW 100 40 0C00 với tốc độ sạc 40W. Mặc dù tên gọi của smartphone CDY-AN00 chưa được tiết lộ nhưng các báo cáo chỉ ra rằng đó là 1 model của Huawei Nova 7.\r\n\r\nChưa dừng lại ở đó, Nova 7 còn được tin sẽ đi kèm với màn hình OLED, máy quét vân tay dưới màn hình để bảo mật sinh trắc học. Trong khi sức mạnh của máy sẽ được hỗ trợ bởi chip Kirin 990 5G mạnh mẽ.\r\n\r\nVẫn còn nhiều thông tin bí ẩn của Nova 7 chưa được tiết lộ, chúng ta cùng kiên nhẫn chờ thêm nhé. Còn bạn, bạn có đang mong chờ Nova 7 không?', 'huawei_06_03_2020_RXgKy4uh_1_1280x720-800-resize.jpg', 6, 0, 8, '2020-03-06 11:49:37', '2020-05-26 02:51:44'),
(9, 'Tin vui cho fan nhà Nokia: HMD sẽ tổ chức sự kiện ra mắt smartphone mới vào ngày 19/3, có Nokia 8.2 5G và nhiều sản phẩm khác', 'Tin vui cho fan nhà Nokia: HMD sẽ tổ chức sự kiện ra mắt smartphone mới vào ngày 19/3, có Nokia 8.2 5G và nhiều sản phẩm khác', 'Đáng lẽ HMD sẽ có 1 sự kiện ra mắt smartphone vào ngày 23/2 tại Đại hội di động thế giới MWC 2020, tuy nhiên, vì dịch bệnh Corona nên MWC đã bị hủy. Bây giờ, hãng đã chính thức xác nhận sắp tổ chức 1 sự kiện khác.\r\n\r\nTheo đó, trên trang Twitter cá nhân của Giám đốc sản phẩm HMD - Juho Sarvikas, ông cho hay, HMD sẽ tổ chức 1 sự kiện vào ngày 19/3 tới đây, tại London. Sự kiện này sẽ là nơi để ra mắt các sản phẩm mà đáng lẽ đã trình làng trong ngày 23/2.\r\n\r\nCó nhiều báo cáo về những smartphone mà HMD sắp ra mắt. Rất có thể, HMD sẽ trình làng chiếc smartphone 5G đầu tiên của họ, Nokia 8.2 (hoặc Nokia 8.3). Ngoài ra, hãng còn có thể ra mắt 2 model giá rẻ khác là Nokia C2 hoặc Nokia 1.3. Thậm chí, HMD sẽ giới thiệu cả mẫu điện thoại cơ bản có tên Nokia 400.\r\n\r\nHiện tại, HMD Global chưa sẵn sàng tung ra 1 flagship mới, nhưng có nhiều báo cáo về việc hãng đang phát triển model kế nhiệm Nokia 9 PureView, thiết bị này có thể được gọi là  Nokia 9.2, máy dùng chip Snapdragon 865 và hỗ trợ 5G.\r\n\r\nVậy bạn có đang mong chờ Nokia 8.2 hay là 1 smartphone Nokia khác?', 'nokia_06_03_2020_gUhv6bNM_nokia.jpg', 6, 0, 9, '2020-03-06 11:51:21', '2020-03-27 09:13:08');
