(22, 'iPhone 11', 23990000, 'Được xem là phiên bản iPhone \"giá rẻ\" trong bộ 3 iPhone mới ra mắt nhưng iPhone 11 128GB vẫn sở hữu cho mình rất nhiều ưu điểm mà hiếm có một chiếc smartphone nào khác sở hữu.\r\n\r\nNâng cấp mạnh mẽ về cụm camera\r\nNăm nay với iPhone 11 thì Apple đã nâng cấp khá nhiều về camera nếu so sánh với chiếc iPhone Xr 128GB năm ngoái.\r\n\r\nCamera trước cũng đã tốt hơn nhiều\r\nĐầu tiên phải kể đến là độ phân giải camera trước đã được nâng từ 7 MP lên thành 12 MP cho người dùng những bức ảnh chi tiết hơn.\r\n\r\nHiệu năng mạnh mẽ hàng đầu thế giới\r\nHiệu năng luôn là vấn đề mà người dùng iPhone chưa bao giờ phải phàn nàn và với iPhone 11 128GB năm nay cũng không phải là ngoại lệ.\r\n\r\nPin đã tốt nay còn tốt hơn\r\nNhư các bạn đã biết thì iPhone Xr năm ngoái là chiếc iPhone có thời lượng pin tốt nhất từ trước tới nay của Apple.\r\n\r\nMàu sắc mới trên chiếc iPhone này hứa hẹn cũng sẽ khiến người dùng phải mê mệt và muốn bỏ tiền ra sở hữu ngay và luôn một chiếc.', 'phone_18_02_2020_dutL9_iphone-11-128gb-green-400x460.png', 'IPS LCD, 6.1\", Liquid Retina', 'iOS 13', '3 camera 12 MP', '12 MP', 'Apple A13 Bionic 6 nhân', '128 GB', '4 GB', 'Xanh lá', '3110 mAh, có sạc nhanh', 200, 3, 1, '2020-02-18 09:42:55', '2020-02-22 05:51:53'),
(23, 'iPhone 11', 21990000, 'Được xem là phiên bản iPhone \"giá rẻ\" trong bộ 3 iPhone mới ra mắt nhưng iPhone 11 128GB vẫn sở hữu cho mình rất nhiều ưu điểm mà hiếm có một chiếc smartphone nào khác sở hữu.\r\n\r\nNâng cấp mạnh mẽ về cụm camera\r\nNăm nay với iPhone 11 thì Apple đã nâng cấp khá nhiều về camera nếu so sánh với chiếc iPhone Xr 128GB năm ngoái.\r\n\r\nCamera trước cũng đã tốt hơn nhiều\r\nĐầu tiên phải kể đến là độ phân giải camera trước đã được nâng từ 7 MP lên thành 12 MP cho người dùng những bức ảnh chi tiết hơn.\r\n\r\nHiệu năng mạnh mẽ hàng đầu thế giới\r\nHiệu năng luôn là vấn đề mà người dùng iPhone chưa bao giờ phải phàn nàn và với iPhone 11 128GB năm nay cũng không phải là ngoại lệ.\r\n\r\nPin đã tốt nay còn tốt hơn\r\nNhư các bạn đã biết thì iPhone Xr năm ngoái là chiếc iPhone có thời lượng pin tốt nhất từ trước tới nay của Apple.\r\n\r\nMàu sắc mới trên chiếc iPhone này hứa hẹn cũng sẽ khiến người dùng phải mê mệt và muốn bỏ tiền ra sở hữu ngay và luôn một chiếc.', 'phone_18_02_2020_I5JrA_iphone-11-red-2-400x460-400x460.png', 'IPS LCD, 6.1\", Liquid Retina', 'iOS 13', 'Chính 12 MP & Phụ 12 MP', '12 MP', 'Apple A13 Bionic 6 nhân', '64 GB', '4 GB', 'Đỏ', '3110 mAh, có sạc nhanh', 150, 100, 1, '2020-02-18 09:46:23', '2020-07-10 09:41:38'),
(24, 'Nokia 7.2', 4990000, 'Nokia 7.2 là một chiếc smartphone rất đáng chú ý trong những tháng cuối năm 2019 với thiết kế thời thượng, hệ điều hành mượt mà và cụm camera chất lượng.\r\n\r\nCamera cải tiến mạnh mẽ\r\nCamera là một trong những thay đổi nhiều nhất của Nokia 7.2 so với những thế hệ cũ.\r\n\r\nHiệu năng mượt mà, hỗ trợ lâu dài\r\nCung cấp sức mạnh cho Nokia 7.2 là con chip Snapdragon 660, RAM 4 GB, ROM 64 GB.\r\n\r\nThiết kế mới lạ, thời trang\r\nNokia 7.2 được làm bằng khung nhôm, bao phủ lớp polycarbonate kẹp giữa các tấm kính cường lực Gorilla Glass với hiệu ứng gradient khuếch tán ánh sáng trông rất cao cấp.\r\n\r\nTheo Nokia thì phần khung của máy sẽ cứng cáp gấp đôi nhựa thông thường và nhẹ chỉ bằng một phần hai so với nhôm.\r\n\r\nNokia 7.2 có màn hình lớn hơn đáng kể so với người tiền nhiệm, với kích thước màn hình là 6.3 inch.', 'phone_19_02_2020_J8XMJ_nokia-72-black-400x460.png', 'IPS LCD, 6.3\", Full HD+', 'Android 9 Pie (Android One)', '20 MP', 'Chính 48 MP & Phụ 8 MP, 5 MP', 'Snapdragon 660 8 nhân', '64 GB', '4 GB', 'Đen', '3500 mAh', 98, 2, 9, '2020-02-19 01:39:43', '2020-07-10 09:40:50'),
(25, 'OPPO A5 (2020)', 3390000, 'OPPO A5 (2020) 64GB là mẫu smartphone tầm trung với giá thành phải chăng nhưng được trang bị nhiều công nghệ hấp dẫn hứa hẹn sẽ \"lấy được lòng\" các bạn trẻ năng động, thời trang.\r\n\r\nThiết kế hiện đại, bắt mắt\r\nViệc sở hữu cho mình một ngoại hình rất thu hút sẽ khiến người dùng có nhiều cảm tình hơn và dẫn tới quyết định mua một chiếc smartphone.\r\n\r\nMặt trước là màn hình \"giọt nước\" kích thước 6.5 inch, với diện tích màn hình chiếm toàn mặt trước là 89.3%, bảo vệ bằng kính Gorilla Glass 3+.\r\n\r\nMàn hình này rộng rãi để bạn giải trí, chơi game và hỗ trở khả năng đọc nội dung dưới màn hình mặt trời, chế độ bảo vệ mắt đây là những tính năng thiết thực đối với người dùng.\r\n\r\nPin trâu không lo bị hết\r\nNgày nay, người dùng chúng ta rất ngại phải sạc pin nhiều lần cho smartphone và cường độ sử dụng lại ngày một cao hơn.\r\n\r\nChiếc smartphone OPPO này được cung cấp năng lượng bởi viên pin dung lượng lên đến 5.000 mAh, kết hợp với hệ điều hành ColorOS 6.1 và phần cứng mới giúp sản phẩm tối ưu hơn trong việc sử dụng.\r\n\r\n4 camera gấy ấn tượng mạnh\r\nCamera chính là điểm ấn tượng nhất trên OPPO A5 (2020), sản phẩm này trang bị tới 4 camera gồm: camera chính 12 MP, camera góc rộng 8 MP 119 độ, camera đơn sắc 2 MP và camera hỗ trợ đo độ sâu 2 MP.\r\n\r\nKhông dừng lại ở đó, OPPO A5 (2020) còn hỗ trợ tính năng Ultra Night Mode 2.0 giúp chụp ảnh rõ nét trong điều kiện thiếu sáng, quay video 4K cùng khả năng chống rung.\r\n\r\nMột điều nữa camera selfie 8 MP tích hợp AI hỗ trợ làm đẹp hứa hẹn mang lại cho các chị em những bức hình lung linh để chia sẻ lên mạng xã hội.', 'phone_22_02_2020_AcLTU_oppo-a5-2020-1-400x460.png', 'TFT, 6.5\", HD+', 'Android 9.0 (Pie)', '8 MP', 'Chính 12 MP & Phụ 8 MP, 2 MP, 2 MP', 'Snapdragon 665 8 nhân', '64 GB', '3 GB', 'Trắng', '5000 mAh', 0, 1, 3, '2020-02-22 05:51:34', '2020-03-07 10:21:08'),
(26, 'OPPO A31', 4490000, 'Chiếc điện thoại OPPO A31 2020 4GB/64GB nổi bật với thiết kế màn hình giọt nước tràn viền, bộ ba camera ấn tượng đi kèm hiệu năng tốt với mức giá bán cực kỳ phải chăng. \r\n\r\nMàn hình tràn viền, giải trí không giới hạn\r\nOPPO A31 2020 sử dụng màn hình LCD kích thước 6.5 inch độ phân giải HD+ cho góc nhìn rộng, độ sáng cao, chất lượng hình ảnh được hiển thị sống động, độ tương phản cao và màu sắc chân thực.\r\n\r\nHiệu năng mạnh mẽ trong phân khúc\r\nOPPO A31 2020 được trang bị vi xử lý Helio P35 8 nhân với 4 nhân tốc độ cao 2.3 GHz cùng 4 nhân tốc độ 1.8 GHz, đi kèm dung lượng RAM 4 GB kèm bộ nhớ trong 128 GB đi kèm theo máy giúp mọi tác vụ hằng ngày được xử lý một cách mượt mà ổn định.\r\n\r\nBộ nhớ trong lớn có thể mở rộng qua thẻ nhớ ngoài lên đến 512 GB giúp máy thoải mái lưu trữ hình ảnh, video hay cài đặt các ứng dụng nặng.\r\n\r\nMáy được cài đặt sẵn hệ điều hành Android 9.0 tùy biến trên nền tảng ColorOS 6.1 với giao diện đẹp mắt cùng nhiều hiệu ứng độc đáo, hỗ trợ tối đa trải nghiệm khác hàng. Người dùng cũng nhanh chóng được cập nhật hệ điều hành Android 10 mới nhất.\r\n\r\nBộ 3 camera chất lượng\r\nOPPO A31 nổi bật với thiết kế với bộ ba camera sau được sắp xếp theo chiều dọc bao gồm một camera chính độ phân giải 12 MP và bộ đôi camera phụ 2 MP có chức năng hỗ trợ đo chiều sâu và chụp ảnh macro.\r\n\r\nCamera của máy được tích hợp đầy đủ các tính năng chụp ảnh góc rộng, xóa phông, đáp ứng tốt nhu cầu chụp ảnh của người dùng.\r\n\r\nTính năng chụp ảnh siêu cận cũng được OPPO trang bị cho máy. Tính năng này cho phép chụp ảnh các vật thể nhỏ ở khoảng cách 4 cm. Người dùng có thể thỏa thích sáng tạo với nhiều kệt tác nghệ thuật chụp ảnh macro đang là trào lưu hot hiện nay.\r\n\r\nCamera selfie của máy có độ phân giải 8 MP trứ danh nhà sản xuất OPPO với đầy đủ các tính năng góc rộng, HDR, hay quay phim chất lượng Full HD,... người dùng hoàn toàn yên tâm về chất lượng ảnh selfie mà chiếc điện thoại này mang lại. \r\n\r\nThời lượng pin đủ dùng cho ngày dài\r\nMang trong mình viên pin dung lượng lớn 4.230 mAh đáp ứng tốt nhu cầu sử dụng liên tục nhiều giờ với chỉ duy nhất một lần sạc, nếu nhu cầu không quá cao máy có thể đáp ứng sang ngày thứ hai.\r\n\r\nCảm biến vân tay của máy được đặt ở mặt sau với tốc độ nhận diện nhanh và chính xác, người dùng cũng có thể sử dụng tính năng mở khóa bằng khuôn mặt mở khóa chiếc điện thọa của mình với tốc độ cũng nhanh không kém.', 'phone_06_03_2020_lTPJG_oppo-a31.png', 'IPS LCD, 6.5\", HD+', 'ColorOS 6.1 (Android 9.0)', '8 MP', 'Chính 12 MP & Phụ 2 MP, 2 MP', 'MediaTek Helio P35 8 nhân', '128 GB', '4 GB', 'Trắng', '4230 mAh', 100, 0, 3, '2020-03-06 11:55:40', '2020-03-06 13:30:17'),
(27, 'Samsung Galaxy Fold', 50000000, 'Sau rất nhiều chờ đợi thì Samsung Galaxy Fold - chiếc smartphone màn hình gập đầu tiên của Samsung cũng đã chính thức trình làng với thiết kế mới lạ.\r\nThiết kế 2 màn hình, màn hình uốn dẻo\r\nSamsung Galaxy Fold không chỉ sở hữu một màn hình có thể uốn dẻo mà còn có một màn hình riêng, để có thể sử dụng độc lập khi gập máy lại.\r\n\r\nThoải mái sử dụng nhiều ứng dụng cùng lúc\r\nViệc sở hữu một thiết bị có màn hình lớn thì người dùng sẽ có một trải nghiệm xem phim hay chơi game thoải mái hơn.\r\n\r\nCó tới 6 camera trên máy\r\nSamsung Galaxy Fold sở hữu bộ 3 camera chính ở mặt lưng với khả năng chụp ảnh chân dung cũng như hỗ trợ ống kính góc rộng cho chụp phong cảnh. \r\n\r\nDung lượng pin lớn\r\nMáy có 2 viên pin được phân tách ngay ở phần bản lề điện thoại đem lại tổng dung lượng 4.380 mAh hứa hẹn đáp ứng đủ nhu cầu cả ngày.', 'phone_06_03_2020_3c8Gz_samsung-galaxy-fold-black-400x460.png', 'Chính: Dynamic AMOLED, phụ: Super AMOLED, Chính 7.3\" & Phụ 4.6\", Quad HD (2K)', 'Android 9.0 (Pie)', 'Trong: 10 MP, 8 MP; Ngoài: 10 MP', 'Chính 12 MP & Phụ 12 MP, 16 MP', 'Snapdragon 855 8 nhân', '512 GB', '12 GB', 'Đen', '4380 mAh, có sạc nhanh', 1000, 20, 2, '2020-03-06 12:00:54', '2020-07-10 09:41:53'),
(28, 'iPhone 11 Pro Max 256GB', 36490000, 'iPhone 11 Pro Max 256GB là chiếc iPhone cao cấp nhất trong bộ 3 iPhone Apple giới thiệu trong năm 2019 và quả thực chiếc smartphone này mang trong mình nhiều trang bị xứng đáng với tên gọi \"Pro\".\r\nPro về camera sau\r\n\r\nCamera là một trong những điểm nâng cấp mạnh mẽ nhất năm nay Apple mang đến cho chiếc iPhone 11 Pro Max.\r\n\r\nĐó là lần đầu tiên một chiếc iPhone sở hữu tới 3 camera ở mặt sau với 3 tiêu cự khác nhau mà người ta vẫn gọi là \"từ nhà tới trường\" đáp ứng mọi nhu cầu nhiếp ảnh của người dùng.\r\n\r\nApple cũng mang lại một trải nghiệm rất thông minh khi tất cả máy sẽ tự động quyết định khi nào chụp đêm khi nào không và việc của bạn chỉ là đưa lên và chụp thôi.\r\n\r\nChế độ chân dung không chỉ tốt hơn trong việc lấy nét vào đối tượng muốn chụp, mà còn hoạt động được ở khoảng cách \'bình thường\' nhờ sự trợ giúp của cảm biến độ sâu.\r\n\r\nPro luôn cả camera trước\r\nKhông chỉ có camera sau được nâng cấp mà camera selfie trên iPhone 11 Pro Max cũng được nâng lên độ phân giải 12 MP thay vì 7 MP như trước.\r\n\r\nPro về hiệu năng\r\nTất nhiên rồi, một chiếc iPhone mới ra bao giờ cũng sẽ đứng đầu danh sách những chiếc máy có hiệu năng tốt nhất hiện nay và với iPhone 11 Pro Max 256GB cũng không phải là ngoại lệ.\r\n\r\nMọi game và ứng dụng trên iPhone 11 Pro Max hoạt động rất mượt mà và ổn định, bạn hầu như sẽ không thấy bất cứ độ trễ nào trong quá trình sử dụng.\r\n\r\nPro về thời lượng pin\r\nĐây là chiếc iPhone có dung lượng pin lớn nhất từ trước tới nay mà Apple từng sản xuất.\r\n\r\nBạn có thể sử dụng máy thoải mái từ sáng tới tối mà không cần phải bận tâm về việc nạp năng lượng cho máy giữa chừng.\r\n\r\nNăm nay \"Táo khuyết\" cũng đã lắng nghe người dùng hơn khi trang bị sẵn bên trong hộp của máy một củ sạc nhanh 18W giúp bạn rút ngắn được đáng kể thời gian chờ sạc pin.\r\n\r\nTính năng sạc không dây vẫn được duy trì và thậm chí là sạc nhanh không dây để bạn có thể sử dụng hằng ngày.\r\n\r\nNhững nâng cấp đáng giá khác\r\niPhone năm nay vẫn có thiết kế khung viền thép cứng cáp cùng 2 mặt kính nhưng để hạn chế tối đa mồ hôi và dấu vân tay thì năm nay Apple đã hoàn thiện cho chiếc iPhone 11 Pro Max 256GB mặt lưng dạng kính mờ.\r\n\r\niPhone thường đạt được độ sáng 800 nits, nhưng với Dolby Vision mọi thứ thậm chí còn ấn tượng hơn (lên tới 1200 nits, theo Apple).\r\n\r\nVới những trang bị kể trên thì iPhone 11 Pro Max năm nay sẽ lại bán chạy và mang về thành công lớn cho Apple.', 'phone_06_03_2020_eZEzb_11-pro-max-256gb-black.png', 'OLED, 6.5\", Super Retina XDR', 'iOS 13', '12 MP', '3 camera 12 MP', 'Apple A13 Bionic 6 nhân', '256 GB', '4 GB', 'Đen', '3969 mAh, có sạc nhanh', 99, 1, 1, '2020-03-06 12:12:01', '2020-07-10 09:39:52'),
(29, 'iPhone Xs Max', 30990000, 'Sau 1 năm mong chờ, chiếc smartphone cao cấp nhất của Apple đã chính thức ra mắt mang tên iPhone Xs Max 256 GB. Máy các trang bị các tính năng cao cấp nhất từ chip A12 Bionic, dàn loa đa chiều cho tới camera kép tích hợp trí tuệ nhân tạo.\r\nHiệu năng đỉnh cao cùng chip Apple A12\r\niPhone Xs Max được Apple trang bị cho con chip mới toanh hàng đầu của hãng mang tên Apple A12.\r\n\r\nChip A12 Bionic được xây dựng trên tiến trình 7nm đầu tiên mà hãng sản xuất với 6 nhân đáp ứng vượt trội trong việc xử lý các tác vụ và khả năng tiết kiệm năng lượng tối ưu.\r\n\r\nThiết kế viền thép không gỉ và mặt kính cường lực cao cấp, chắc chắn\r\n Điện thoại iPhone Xs Max sở hữu lối thiết kế vô cùng đẹp mắt với những đường cong mềm mại được thừa hưởng từ chiếc iPhone đời trước đó.\r\n\r\nNhờ thế mà bạn sẽ có một không gian trải nghiệm vô cùng rộng rãi để thưởng thức những bộ phim chất lượng cao được trở nên trọn vẹn.\r\n\r\nMàn hình OLED chất lượng cao rộng 6.5 inch đầu tiên của Apple\r\nVới công nghệ Super Retina kết hợp tấm nền OLED trên iPhone Xs Max đem lại dải màu sắc cực kì sống động và sắc nét đến từng chi tiết.\r\n\r\nViệc sở hữu màn hình lớn đem đến cho bạn khá nhiều tiện ích như dễ dàng chỉnh sửa ảnh, xem phim, lướt web nhưng sẽ khó khăn hơn trong việc di chuyển.\r\n\r\nCamera kép tích hợp trí tuệ nhân tạo\r\nDù không sở hữu thông số camera khủng (chỉ với ống kính chính 12 MP và ống kính phụ 12 MP) nhưng iPhone Xs Max luôn cho thấy sự đẳng cấp của mình về khả năng nhiếp ảnh đỉnh cao.', 'phone_06_03_2020_U7jbx_xs-max-256gb-white-400x460.png', 'OLED, 6.5\", Super Retina XDR', 'iOS 12', '7 MP', 'Chính 12 MP & Phụ 12 MP', 'Apple A12 Bionic 6 nhân', '256 GB', '4 GB', 'Trắng', '3174 mAh, có sạc nhanh', 98, 20, 1, '2020-03-06 12:15:45', '2020-07-10 09:42:12');
